export default function Square() {
  let squares = [];
  for (let i = 1; i < 10; i++) {
    squares.push(i);
  }
  squares.map((square) => {
    <button key={square} className="square">
      {square}
    </button>;
  });
  return <div>{squares}</div>;
}
